message:
Resumo de algumas medidas propostas pela FIEMG - Federação das Indústrias do Estado de Minas Gerais - ao presidente Bolsonaro: 

1) Aumentar a flexibilidade dos trabalhos aos domingos; 
2) Redução de obrigações previdenciárias e com auxílio maternidade para mulheres; 
3) Restrição de competências da fiscalização do trabalho; 
4) Aumento da jornada noturna e jornada de motoristas; 
5) Fim da multa rescisória (40%). 
                     ------------------------------------------------------------
O pacote de maldade tá aí. Defender o trabalho também é defender a família.
